

CREATE TABLE `Izmjene` (
  `RnBr` int(100) NOT NULL AUTO_INCREMENT,
  `Prof` tinyint(4) NOT NULL,
  `Predmet` tinyint(4) NOT NULL,
  `Ocjena` tinyint(4) NOT NULL,
  `Brojuc` tinyint(4) NOT NULL,
  `Razred` varchar(1000) COLLATE latin1_general_ci NOT NULL,
  `Zakljucna` tinyint(4) NOT NULL,
  `Datum` int(10) NOT NULL,
  `Pravi` int(10) NOT NULL,
  `Tajp` tinyint(4) NOT NULL DEFAULT '0',
  PRIMARY KEY (`RnBr`)
) ENGINE=MyISAM AUTO_INCREMENT=35 DEFAULT CHARSET=latin1 COLLATE=latin1_general_ci;






CREATE TABLE `Klase` (
  `ID` int(11) NOT NULL AUTO_INCREMENT,
  `Ime` varchar(50) COLLATE latin1_general_ci NOT NULL,
  `Prof` int(11) NOT NULL,
  `Pred` int(11) NOT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=MyISAM AUTO_INCREMENT=4 DEFAULT CHARSET=latin1 COLLATE=latin1_general_ci;






CREATE TABLE `Monitoring` (
  `ID` int(11) NOT NULL AUTO_INCREMENT,
  `User` varchar(100) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `Username` varchar(100) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `Prof` tinyint(4) NOT NULL,
  `Str` varchar(1000) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `Oklen` varchar(1000) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `IP` varchar(100) COLLATE latin1_general_ci NOT NULL,
  `Time` int(11) NOT NULL,
  `Sve` varchar(1000) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `Admin` tinyint(4) NOT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=MyISAM AUTO_INCREMENT=2917 DEFAULT CHARSET=latin1 COLLATE=latin1_general_ci;






CREATE TABLE `Napomene` (
  `ID` int(11) NOT NULL AUTO_INCREMENT,
  `Prof` int(11) NOT NULL,
  `Broj` int(11) NOT NULL,
  `Razz` varchar(10) COLLATE latin1_general_ci NOT NULL,
  `Napomena` varchar(5000) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `Datum` varchar(100) COLLATE latin1_general_ci NOT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1 COLLATE=latin1_general_ci;






CREATE TABLE `Obavijesti` (
  `ID` int(10) NOT NULL AUTO_INCREMENT,
  `Autor` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `Msg` varchar(10000) COLLATE utf8_unicode_ci NOT NULL,
  `Date` varchar(20) CHARACTER SET latin1 COLLATE latin1_general_ci NOT NULL,
  `Razz` varchar(20) COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;






CREATE TABLE `Poruke` (
  `ID` int(11) NOT NULL AUTO_INCREMENT,
  `Odkoga` varchar(100) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `Zakoga` varchar(100) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `Poruka` varchar(10000) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `Procitana` int(11) NOT NULL DEFAULT '0',
  `Time` varchar(100) COLLATE latin1_general_ci NOT NULL,
  `Oklen` varchar(1000) COLLATE latin1_general_ci NOT NULL,
  `IP` varchar(100) COLLATE latin1_general_ci NOT NULL,
  `Sve` varchar(1000) COLLATE latin1_general_ci NOT NULL,
  `Adm` tinyint(4) NOT NULL DEFAULT '0',
  PRIMARY KEY (`ID`)
) ENGINE=MyISAM AUTO_INCREMENT=7 DEFAULT CHARSET=latin1 COLLATE=latin1_general_ci;






CREATE TABLE `PredPoRazz` (
  `ID` int(11) NOT NULL AUTO_INCREMENT,
  `Predmet` tinyint(4) NOT NULL DEFAULT '0',
  `1` tinyint(4) NOT NULL DEFAULT '0',
  `2` tinyint(4) NOT NULL DEFAULT '0',
  `3` tinyint(4) NOT NULL DEFAULT '0',
  `4` tinyint(4) NOT NULL DEFAULT '0',
  PRIMARY KEY (`ID`)
) ENGINE=MyISAM AUTO_INCREMENT=37 DEFAULT CHARSET=latin1 COLLATE=latin1_general_ci;






CREATE TABLE `Predmeti` (
  `RnBr` int(20) NOT NULL AUTO_INCREMENT,
  `Predmet` varchar(200) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL,
  PRIMARY KEY (`RnBr`)
) ENGINE=MyISAM AUTO_INCREMENT=38 DEFAULT CHARSET=latin1 COLLATE=latin1_general_ci;






CREATE TABLE `Profesori` (
  `RnBr` int(4) NOT NULL AUTO_INCREMENT,
  `Username` varchar(50) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL,
  `Ime` varchar(50) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL,
  `Prezime` varchar(50) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL,
  `Pass` varchar(100) COLLATE latin1_general_ci NOT NULL,
  `Predmet` int(4) NOT NULL,
  `Razrednik` varchar(6) COLLATE latin1_general_ci NOT NULL DEFAULT '0',
  `Direktor` int(11) NOT NULL DEFAULT '0',
  `Img` varchar(1000) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL DEFAULT 'http://www.stealthproducts.com/seatingOF/images/avatars/no-avatar.jpg',
  `Reg` varchar(15) COLLATE latin1_general_ci NOT NULL,
  `Radi` tinyint(4) NOT NULL DEFAULT '1',
  PRIMARY KEY (`RnBr`),
  UNIQUE KEY `User` (`Username`)
) ENGINE=MyISAM AUTO_INCREMENT=29 DEFAULT CHARSET=latin1 COLLATE=latin1_general_ci;






CREATE TABLE `Razredi` (
  `ID` int(11) NOT NULL AUTO_INCREMENT,
  `1` int(11) NOT NULL DEFAULT '0',
  `2` int(11) NOT NULL DEFAULT '0',
  `3` int(11) NOT NULL DEFAULT '0',
  `4` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`ID`)
) ENGINE=MyISAM AUTO_INCREMENT=29 DEFAULT CHARSET=latin1 COLLATE=latin1_general_ci;






CREATE TABLE `Sesije` (
  `ID` int(11) NOT NULL AUTO_INCREMENT,
  `User` int(11) NOT NULL,
  `Username` varchar(100) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `Prof` tinyint(4) NOT NULL,
  `Time` int(11) NOT NULL,
  `IP` varchar(200) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `Sve` varchar(1000) COLLATE latin1_general_ci NOT NULL,
  `Odjava` tinyint(4) NOT NULL,
  `Admin` tinyint(4) NOT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=MyISAM AUTO_INCREMENT=275 DEFAULT CHARSET=latin1 COLLATE=latin1_general_ci;






CREATE TABLE `Smjerovi` (
  `ID` tinyint(4) NOT NULL AUTO_INCREMENT,
  `Ime` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `Klavir` tinyint(4) NOT NULL,
  `Kor` tinyint(4) NOT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=MyISAM AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;






CREATE TABLE `Spisak` (
  `Broj` int(2) NOT NULL AUTO_INCREMENT,
  `1` varchar(100) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL,
  `2` varchar(100) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL,
  `3` varchar(100) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL,
  `4` varchar(100) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL,
  PRIMARY KEY (`Broj`)
) ENGINE=MyISAM AUTO_INCREMENT=34 DEFAULT CHARSET=latin1 COLLATE=latin1_general_ci;






CREATE TABLE `Struka` (
  `ID` int(11) NOT NULL AUTO_INCREMENT,
  `Pred` tinyint(4) NOT NULL,
  `Smjer` tinyint(4) NOT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=MyISAM AUTO_INCREMENT=13 DEFAULT CHARSET=latin1 COLLATE=latin1_general_ci;






CREATE TABLE `Ucukl` (
  `ID` int(11) NOT NULL AUTO_INCREMENT,
  `IDklase` int(11) NOT NULL,
  `bruc` int(11) NOT NULL,
  `ruc` varchar(5) COLLATE latin1_general_ci NOT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=MyISAM AUTO_INCREMENT=18 DEFAULT CHARSET=latin1 COLLATE=latin1_general_ci;






CREATE TABLE `Vise` (
  `ID` int(11) NOT NULL AUTO_INCREMENT,
  `Profa` int(11) NOT NULL,
  `Pred` int(11) NOT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=MyISAM AUTO_INCREMENT=19 DEFAULT CHARSET=latin1 COLLATE=latin1_general_ci;






CREATE TABLE `Vladanja` (
  `ID` int(11) NOT NULL AUTO_INCREMENT,
  `Prof` varchar(200) CHARACTER SET latin1 COLLATE latin1_general_ci NOT NULL,
  `BrUc` varchar(200) CHARACTER SET latin1 COLLATE latin1_general_ci NOT NULL,
  `Razz` varchar(20) CHARACTER SET latin1 COLLATE latin1_general_ci NOT NULL,
  `Razlog` varchar(10000) COLLATE utf8_unicode_ci NOT NULL,
  `Ocjena` int(11) NOT NULL,
  `Datum` varchar(30) CHARACTER SET latin1 COLLATE latin1_general_ci NOT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;






CREATE TABLE `users` (
  `UserID` int(11) NOT NULL AUTO_INCREMENT,
  `Username` varchar(20) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `Pass` varchar(100) CHARACTER SET latin1 COLLATE latin1_general_ci NOT NULL,
  `Ime` varchar(100) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL,
  `Prezime` varchar(100) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL,
  `Razred` varchar(3) NOT NULL,
  `BrDn` int(2) NOT NULL,
  `Smjer` tinyint(4) NOT NULL,
  `Fran` tinyint(4) NOT NULL,
  `Img` varchar(1000) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL DEFAULT 'https://flickflyer.com/images/user.png',
  `Ime_oca` varchar(100) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `Adresa` varchar(1000) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `Mjesto` varchar(1000) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `Datumr` tinyint(4) NOT NULL,
  `Mjesecr` tinyint(4) NOT NULL,
  `Godinar` smallint(6) NOT NULL,
  `Mjestor` varchar(1000) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `Brojmob` varchar(100) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `Reg` int(11) NOT NULL,
  `Akt` tinyint(4) NOT NULL DEFAULT '0',
  `Admin` tinyint(4) NOT NULL DEFAULT '0',
  PRIMARY KEY (`UserID`)
) ENGINE=MyISAM AUTO_INCREMENT=24 DEFAULT CHARSET=latin1;




